  false,\n\t\"url\": null,\n\t\"notes\": \"This survey provides the baseline understanding
  of aquatic health in our rivers, lakes, and marshes. The Refuge staff lacks consistent
  water chemistry measurements, despite the importance of water quality to aquatic
  health. Poor aquatic health was identified as a primary issue in the CCP. Carp control
  and other management actions (e.g., restoration of riparian) should result in increased
  aquatic health. Water quality is one parameter of aquatic health and, therefore,
  baseline water chemistry data are important. Water quality will also be monitored
  after management actions to evaluate success.\",\n\t\"license_title\": \"License
